import styled from 'styled-components';
import { darken } from 'polished';

export const Container = styled.div`
  margin: 0 auto;
  justify-content: center;
  align-items: center;
  max-width: 900px;
  width: 100%;
`;

export const Title = styled.div`
  margin: 40px 0;
  display: flex;
  justify-content: space-between strong {
    font-size: 20px;
    color: #444;
  }
`;
